                <div><span>Front-end Developer</span></div>
                <div><span>Email. </span>gothddlek@naver.com</div>
                <div><span>Birth. </span>2001.06.30</div>
                <div><span>Residence. </span>South Korea</div>
                <div><span>Bachelor Degree. </span>Kumoh Institute of Technology. Electronic IT convergence (2020.03 - 2024.02)</div>
            </section>
            <section className='Info__introduce'>
                <div>Hello, my name is JaeHyun Ahn.</div>
            </section>
        </main>
    );
};

export default Info;
